B.Uo=new A.a7("1. Comercializar biopreparados sin registro ICA.\n\n2. Incluir dentro de la producci\xf3n de los biopreparados agr\xedcolas, mol\xe9culas consideradas como plaguicidas qu\xedmicos de uso agr\xedcola.\n\n3. Hacer publicidad a productos usando el nombre del ICA o sus signos distintivos para fines de promoci\xf3n comercial.\n\n4. Incluir informaci\xf3n no aprobada por el ICA en las etiquetas o la publicidad de productos en prensa, radio, hojas volantes, plegables u otro medio de comunicaci\xf3n.\n\n5. Producir biopreparados para uso agr\xedcola utilizando procedimientos o materiales que contengan organismos pat\xf3genos para el ambiente, la salud humana o la sanidad agropecuaria.\n",null,B.cB,null,null,null,null,null,null)
