B.UK=new A.a7("Se pueden usar materiales disponibles propios de las fincas o unidades productivas que se puedan reutilizar, como recipientes, mangueras, entre otros, siempre y cuando no sean envases donde se hayan contenido insumos agr\xedcolas como plaguicidas.\n\nEl productor deber\xe1 almacenar la informaci\xf3n del biopreparado por un periodo de 5 a\xf1os y garantizar la ausencia de pat\xf3genos en el producto elaborado.\n\nLas pr\xe1cticas de fabricaci\xf3n deben realizarse a partir de material conocido y propio del predio, cumpliendo las siguientes condiciones:",null,B.aZ,B.a5,null,null,null,null,null)
